import React from 'react';
import './DropCard.scss';

export interface Drop {
  id: string;
  userId: string;
  name: string;
  avatar?: string;
  quality: 'common' | 'rare' | 'epic' | 'legendary';
  level: number;
  incomePerHour: number;
  incomeMultiplier: number;
  lastSeen: string;
  createdAt: string;
  updatedAt?: string;
}

interface DropCardProps {
  drop: Drop;
  onUpgrade: (dropId: string) => void;
  onRelease: (dropId: string) => void;
  onExtraPayment: (dropId: string) => void;
  isSelectable?: boolean;
  isSelected?: boolean;
  onSelect?: (dropId: string) => void;
}

const DropCard: React.FC<DropCardProps> = ({ 
  drop, 
  onUpgrade, 
  onRelease, 
  onExtraPayment,
  isSelectable = false,
  isSelected = false,
  onSelect
}) => {
  const isActive = (): boolean => {
    const lastSeen = new Date(drop.lastSeen);
    const now = new Date();
    // Если заходил менее 24 часов назад, дроп активен
    return (now.getTime() - lastSeen.getTime()) / (1000 * 60 * 60) < 24;
  };

  const formatIncome = (income: number): string => {
    return new Intl.NumberFormat('ru-RU').format(income);
  };

  const getQualityClass = (): string => {
    return `quality-${drop.quality}`;
  };
  
  const getQualityText = (): string => {
    switch (drop.quality) {
      case 'common':
        return 'Обычный';
      case 'rare':
        return 'Редкий';
      case 'epic':
        return 'Эпический';
      case 'legendary':
        return 'Легендарный';
      default:
        return '';
    }
  };

  const handleCardClick = () => {
    if (isSelectable && onSelect) {
      onSelect(drop.id);
    }
  };

  const handleButtonClick = (
    e: React.MouseEvent<HTMLButtonElement>,
    action: 'upgrade' | 'release' | 'extraPayment'
  ) => {
    e.stopPropagation();
    
    switch (action) {
      case 'upgrade':
        onUpgrade(drop.id);
        break;
      case 'release':
        onRelease(drop.id);
        break;
      case 'extraPayment':
        onExtraPayment(drop.id);
        break;
    }
  };
  
  return (
    <div
      className={`drop-card ${getQualityClass()} ${isSelectable ? 'selectable' : ''} ${isSelected ? 'selected' : ''}`}
      onClick={handleCardClick}
    >
      <div className="drop-card-header">
        <div className="avatar-container">
          {drop.avatar ? (
            <img src={drop.avatar} alt={drop.name} className="avatar" />
          ) : (
            <div className="avatar-placeholder">{drop.name[0]}</div>
          )}
        </div>
        <div className="drop-info">
          <div className="drop-name">{drop.name}</div>
          <div className="drop-quality">{getQualityText()}</div>
        </div>
      </div>
      
      <div className="drop-card-body">
        <div className="drop-stats">
          <div className="stat-item">
            <span className="stat-label">Уровень:</span>
            <span className="stat-value">{drop.level}</span>
          </div>
          <div className="stat-item">
            <span className="stat-label">Доход/час:</span>
            <span className="stat-value">{formatIncome(drop.incomePerHour)} ₽</span>
          </div>
          <div className="stat-item">
            <span className="stat-label">Множитель:</span>
            <span className="stat-value">x{drop.incomeMultiplier.toFixed(1)}</span>
          </div>
        </div>
      </div>
      
      <div className="drop-card-actions">
        <button onClick={(e) => handleButtonClick(e, 'upgrade')}>Улучшить</button>
        <button onClick={(e) => handleButtonClick(e, 'extraPayment')}>Доплатить</button>
        <button 
          onClick={(e) => handleButtonClick(e, 'release')}
          className="danger"
        >
          Отпустить
        </button>
      </div>
    </div>
  );
};

export default DropCard;
